import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();
        int D = sc.nextInt();

        int setsX = (N + A - 1) / A;
        int costX = setsX * B;

        int setsY = (N + C - 1) / C;
        int costY = setsY * D;

        System.out.println(Math.min(costX, costY));

        sc.close();
    }
}

