import java.util.Scanner;

public class Main {

  public static void main(String[] args) {
    Scanner sc = new Scanner(System.in);

    while (true) {
      int m = sc.nextInt();
      int f = sc.nextInt();
      int r = sc.nextInt();

      if (m == -1 && f == -1 && r == -1) {
        break;
      }

      char grade = calculateGrade(m, f, r);
      System.out.println(grade);
    }

    sc.close();
  }

  private static char calculateGrade(int m, int f, int r) {
    if (m == -1 || f == -1) {
      return 'F';
    }

    int total = m + f;

    if (total >= 80) {
      return 'A';
    } else if (total >= 65) {
      return 'B';
    } else if (total >= 50) {
      return 'C';
    } else if (total >= 30) {
      if (r >= 50) {
        return 'C';
      } else {
        return 'D';
      }
    } else {
      return 'F';
    }
  }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
