public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }
        int q = sc.nextInt();
        for (int i = 0; i < q; i++) {
            int com = sc.nextInt();
            int b = sc.nextInt();
            int e = sc.nextInt();
            if (com == 0) {
                int min = a[b];
                for (int j = b + 1; j < e; j++) {
                    if (a[j] < min) {
                        min = a[j];
                    }
                }
                System.out.println(min);
            } else {
                int max = a[b];
                for (int j = b + 1; j < e; j++) {
                    if (a[j] > max) {
                        max = a[j];
                    }
                }
                System.out.println(max);
            }
        }
        sc.close();
    }
}

