public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int a = sc.nextInt();
        int b = sc.nextInt();
        int c = sc.nextInt();
        int d = sc.nextInt();
        int e = sc.nextInt();
        int k = sc.nextInt();

        if (e - a > k) {
            System.out.println(":(");
        } else {
            System.out.println("Yay!");
        }

        sc.close();
    }
}

